import './style.css'
function RoomItem() {
    return (

        <div className = 'item-wrapper'>
            <img class = 'item-img' src="https://kreatecube.com/usefull/vendor/12222/gallery/2971.jpg" 
                alt="Avatar" 
            />
            <div class="container">
                <h4><b>John Doe</b></h4>
                <p>Architect & Engineer</p>
            </div>
        </div>
    );
}

export default RoomItem;
